import React from 'react';

export default function Nav2({ items }) {
  return (
    <div>
      { items.map(item => {
        return (
          <div class="tab">
            <svg height="25" width="30" class="slidein">
              <line x1="0" y1="0" x2="30" y2="0" style="stroke:rgb(239, 239, 239);stroke-width:4" id="line1"/>
              Sorry, your browser does not support inline SVG.
            </svg>
            <p class="name hidden" id="name1">{ item }</p>
          </div>
        )
      }) }
    </div>
  )
};
